import React from 'react';

const style = `
.btn-portfolio {
  height: 50px;
  min-width: 50px;
  width: 150px;
  border: 1px solid white;
  border-radius: 30px;
  color: white;
}
`;

const Buttons = ({ info }) => {
  return (
    <div className="btn-portfolio">
      <svg viewBox="0 0 12 24" aria-hidden="true"><path d={info.logoPath} /></svg>
      <h4>{info.name}</h4>
      <style>{style}</style>
    </div>
  );
};

export default Buttons;
